import React from "react";
import { Drawer, List, ListItem, ListItemIcon, ListItemText, Box } from "@mui/material";
import { Home, Calculate, School, EventNote } from "@mui/icons-material";
import { Link } from "react-router-dom";
import logo from "../assets/AptitudeArc.jpg";

const Sidebar = () => {
  return (
    <Drawer
      variant="permanent"
      sx={{
        width: 240,
        flexShrink: 0,
        "& .MuiDrawer-paper": { width: 240, boxSizing: "border-box", backgroundColor: "#fff" },
      }}
    >
      {/* Logo Section */}
      <Box sx={{ display: "flex", justifyContent: "center", alignItems: "center", p: 2 }}>
  <img src={logo} alt="AptitudeArc Logo" style={{ width: "80%", maxWidth: "150px", borderRadius: "8px" }} />
</Box>

      {/* Navigation List */}
      <List>
        <ListItem button component={Link} to="/">
          <ListItemIcon><Home /></ListItemIcon>
          <ListItemText primary="Home" />
        </ListItem>
        <ListItem button component={Link} to="/general-aptitude">
          <ListItemIcon><Calculate /></ListItemIcon>
          <ListItemText primary="General Aptitude" />
        </ListItem>
        <ListItem button component={Link} to="/interview">
          <ListItemIcon><EventNote /></ListItemIcon>
          <ListItemText primary="Interview" />
        </ListItem>
        <ListItem button component={Link} to="/engineering">
          <ListItemIcon><School /></ListItemIcon>
          <ListItemText primary="Engineering" />
        </ListItem>
      </List>
    </Drawer>
  );
};

export default Sidebar;
